import axios from 'axios';

export async function createShortUrl(data) {
    const res = await axios.post('http://localhost:5000/shorturls', data)
    return res.data
}

export async function getShortUrlStatistics(shortcode) {
    const res = await axios.get(`http://localhost:5000/shorturls/${shortcode}`)
    return res.data
}
